! function(e) {
    "use strict";
    e("#contactForm").length > 0 && e("#contactForm").validate({
        submitHandler: function(n) {
            var t = e(".submitting");
            e.ajax({
                type: "POST",
                url: "https://sheetdb.io/api/v1/flgnpdfv925rw",
                data: e(n).serialize(),
                beforeSend: function() {
                    t.css("display", "block").text("Submitting...")
                },
                success: function(n) {
                    "OK" == n ? (e("#form-message-warning").hide(), setTimeout(function() {
                        e("#contactForm").fadeIn()
                    }, 1e3), setTimeout(function() {
                        e("#form-message-success").fadeIn()
                    }, 1400), setTimeout(function() {
                        e("#form-message-success").fadeOut()
                    }, 8e3), setTimeout(function() {
                        t.css("display", "none").text("Submitting...")
                    }, 1400), setTimeout(function() {
                        e("#contactForm").each(function() {
                            this.reset()
                        })
                    }, 1400)) : (e("#form-message-warning").html(n), e("#form-message-warning").fadeIn(), t.css("display", "none")), window.location.replace("done.html")
                },
                error: function() {
                    e("#form-message-warning").html("Something went wrong. Please try again."), e("#form-message-warning").fadeIn(), t.css("display", "none")
                }
            })
        }
    })
}(jQuery);
